Cast: Charley Chase, Elena Heiress, Laurie Vargas, Luscious Lopez, Tia Cyrus

Once again, Marc Twain, a master lensman, manages to round up some of the hottest young Latina talent around. Shot off the cuff, and very gonzo, these ladies melt the lense with some hot scorching ball busting action. Plenty of soaking wet Latina quim bursts all over the lense. When the girl starts screaming weird shit in Spanish, you know its good.
